      SELECT DISTINCT MIN ( DISTINCT - + 23 ) AS col1 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1

outputs:
  - name: q2124.out
    data: |
      -23
